import Vue from "vue";
import Vuex from "vuex";
Vue.use(Vuex);

export default new Vuex.Store({
  store: {
    lists: [
        { id: 1,  title: '会議資料の作成',
          deadline: new Date(), check: false },
        { id: 2,  title: '現場工程の段取り',
          deadline: new Date(), check: false },
        { id: 3,  title: '部品の手配',
          deadline: new Date(), check: false },
      ],
      sequence: 1
  },
  getters: {},
  mutations: {},
  actions: {}

});
